import axios from "axios";
import { useState, useEffect } from "react";
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import "bootstrap/dist/css/bootstrap.min.css";

const Employee = () => {
    const [data, setData] = useState([]);
    const [id, setId] = useState(0);
    const [name, setName] = useState("");
    const [status, setStatus] = useState(false);
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    useEffect(() => {
        axios({
            method: "GET",
            url: "http://localhost:8088/api/employee"
        }).then((response) => {
            setData(response.data.data);
        }).catch((error) => {
            console.log(error);
        });
    }, [status]);

    const onSubmit = () => {
        handleClose();

        let requestData = {
            "employee_id": id,
            "employee_name": name
        };

        let requestMethod = id ? "PUT" : "POST";
        let url = id ? `http://localhost:8088/api/employee/${id}` : "http://localhost:8088/api/employee";

        axios({
            method: requestMethod,
            headers: {
                'Content-Type': 'application/json',
            },
            url: url,
            data: JSON.stringify(requestData)
        }).then((response) => {
            if (response.data.status === 200) {
                setStatus(true);
                setId(0);
                setName("");
            }
        }).catch((error) => {
            console.log(error);
        }).finally(() => {
            setStatus(false);
        });
    };

    const handleEdit = (employee) => {
        setId(employee.employee_id);
        setName(employee.name);
        handleShow();
    };

    const handleDelete = (Id) => {
        axios({
            method: "DELETE",
            url: `http://localhost:8088/api/employee/${Id}`
        }).then((response) => {
            if (response.data.status === 200) {
                setStatus(true);
            }
        }).catch((error) => {
            console.log(error);
        }).finally(() => {
            setStatus(false);
        });
    };

    return (
        <div>
            <button onClick={handleShow}>Create</button>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>NAME</th>
                        <th>ACTION</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map(x => {
                        return (
                            <tr key={x.employee_id}>
                                <td>{x.employee_id}</td>
                                <td>{x.employee_name}</td>
                                <td>
                                    <button onClick={() => handleEdit(x.employee_id)}>Edit</button>
                                    <button onClick={() => handleDelete(x.employee_id)}>Delete</button>
                                </td>
                            </tr>
                        );
                    })}
                </tbody>
            </table>
            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Modal heading</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <input type="text" id="employee_id" value={id} onChange={e => setId(e.target.value)} />
                    <input type="text" id="employee_name" value={name} onChange={e => setName(e.target.value)} />
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                    <Button variant="primary" onClick={onSubmit}>
                        Save Changes
                    </Button>
                </Modal.Footer>
            </Modal>
        </div>
    );
};

export default Employee;
